import { NavItem } from "./NavItem";

export const Menu = () => {
  const navItemsList = [
    "about",
    "team",
    // "schedule",
    // "news",
    "media",
    "contacts",
  ];
  const navItemsText = [
    "О студии",
    "Наша команда",
    // "Расписание",
    // "Новости",
    "Галерея",
    "Контакты",
  ];

  const navItems = navItemsList.map((menuItem, key) => (
    <NavItem key={key} item={menuItem} text={navItemsText[key]} />
  ));

  // Верните созданный массив JSX-элементов
  return <div className="menu">{navItems}</div>;
};
